window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"27.0.2","implementation":{"version":"11.2.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.26100"},"runtime":{"name":"node.js","version":"20.17.0"}}},{"source":{"data":"# Feature: Vision board CRUD Operations\r\n\r\n#     #  @run\r\n#   Scenario: Create, update, and delete a Vision board\r\n#   Given I am logged in and on the projects page\r\n#   When I select a project from the list for vision board\r\n#   And I click on the Vision tab \r\n#   Then the Vision tab should be visible\r\n#   And I click on the new board name input field\r\n#   And I enter \"Test board\" into the board name field\r\n#   And I click the new button\r\n#   Then the \"Test board\" vision board should be created successfully\r\n#   When I update the vision board name\r\n#   And I press Enter to confirm vision board name\r\n#   Then the board name should be updated to \"update board name\"\r\n#   When I click on the archives icon of the board\r\n#   And I click on okay button to confirm the vision board deletion\r\n#   Then the board should be deleted successfully\r\n\r\n","uri":"features\\Vision-crud.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"comments":[{"location":{"line":1,"column":1},"text":"# Feature: Vision board CRUD Operations"},{"location":{"line":3,"column":1},"text":"#     #  @run"},{"location":{"line":4,"column":1},"text":"#   Scenario: Create, update, and delete a Vision board"},{"location":{"line":5,"column":1},"text":"#   Given I am logged in and on the projects page"},{"location":{"line":6,"column":1},"text":"#   When I select a project from the list for vision board"},{"location":{"line":7,"column":1},"text":"#   And I click on the Vision tab "},{"location":{"line":8,"column":1},"text":"#   Then the Vision tab should be visible"},{"location":{"line":9,"column":1},"text":"#   And I click on the new board name input field"},{"location":{"line":10,"column":1},"text":"#   And I enter \"Test board\" into the board name field"},{"location":{"line":11,"column":1},"text":"#   And I click the new button"},{"location":{"line":12,"column":1},"text":"#   Then the \"Test board\" vision board should be created successfully"},{"location":{"line":13,"column":1},"text":"#   When I update the vision board name"},{"location":{"line":14,"column":1},"text":"#   And I press Enter to confirm vision board name"},{"location":{"line":15,"column":1},"text":"#   Then the board name should be updated to \"update board name\""},{"location":{"line":16,"column":1},"text":"#   When I click on the archives icon of the board"},{"location":{"line":17,"column":1},"text":"#   And I click on okay button to confirm the vision board deletion"},{"location":{"line":18,"column":1},"text":"#   Then the board should be deleted successfully"}],"uri":"features\\Vision-crud.feature"}},{"source":{"data":" @area-crud\r\nFeature: Area CRUD Operations\r\n\r\n  @run\r\n  Scenario: Create a new area\r\n    Given I am logged in and on the projects page\r\n    When I select a project from the list of projects\r\n    And I click on the new area input field\r\n    And I enter \"Test area\" into the area name field\r\n    And I click the Add Area button\r\n    Then the \"Test area\" area should be created successfully\r\n\r\n  @run\r\n  Scenario: verify the area name\r\n    Given I am logged in and on the projects page\r\n    When I select a project from the list\r\n    And I click on the area with name \"Test area\"\r\n    Then the area details should show name \"Test area\"\r\n\r\n  @run\r\n  Scenario: Update an existing area\r\n    Given I am logged in and on the projects page\r\n    When I select a project from the list\r\n    And I click on the area with name \"Test area\"\r\n    And I update the area name\r\n    And I press Enter\r\n    Then the area name should be updated to \"update area name\"\r\n\r\n  @run\r\n  Scenario: Delete an existing area\r\n    Given I am l 420c-b4af-aed4148c9e4c"]}]}},{"source":{"data":"Feature: Verify Project Settings Content\r\n  \r\n@project-settings-content\r\n  Scenario: Verify the content structure of the Project Settings modal\r\n    Given I am logged in and on the projects page\r\n    When I select a project from the list\r\n    When I click on the gear icon\r\n    Then project settings modal should open\r\n    And the modal should display three columns\r\n    And the first column should contain input fields\r\n    And the second column should contain checkboxes for client actions\r\n    And the third column should contain checkboxes for client visibility ","uri":"features\\project-settings-content.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Verify Project Settings Content","description":"","children":[{"scenario":{"id":"b313c055-6552-49bd-ad44-277c7bf1aab0","tags":[{"location":{"line":3,"column":1},"name":"@project-settings-content","id":"adb271c0-8847-4ba9-80cd-b04e70123dc3"}],"location":{"line":4,"column":3},"keyword":"Scenario","name":"Verify the content structure of the Project Settings modal","description":"","steps":[{"id":"692a045e-a500-4690-aaa6-3c3c6d0c00bd","location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"I am logged in and on the projects page"},{"id":"f7e9fdb5-75a9-4f1a-b79e-56764640e4f0","location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"I select a project from the list"},{"id":"7f9693c1-d4e9-488e-b5bf-c1850993ce37","location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"I click on the gear icon"},{"id":"7937598e-f64a-4ad4-b948-f333d8610920","location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"project settings modal should open"},{"id":"a776b9bc-891e-4860-9ac2-d6a6bce2342c","location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the modal should display three columns"},{"id":"e8f71ae0-e71d-4570-8c61-4b95d6840c09","location":{"line":10,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the first column should contain input fields"},{"id":"af698707-4a0b-4f9d-9322-5628d07d6035","location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the second column should contain checkboxes for client actions"},{"id":"0d522c71-79bd-4ff4-8496-1dd33ec45b07","location":{"line":12,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the third column should contain checkboxes for client visibility"}],"examples":[]}}]},"comments":[],"uri":"features\\project-settings-content.feature"}},{"pickle":{"id":"3700624c-1684-4cf8-8fa2-84df22408d67","uri":"features\\project-settings-content.feature","astNodeIds":["b313c055-6552-49bd-ad44-277c7bf1aab0"],"tags":[{"name":"@project-settings-content","astNodeId":"adb271c0-8847-4ba9-80cd-b04e70123dc3"}],"name":"Verify the content structure of the Project Settings modal","language":"en","steps":[{"id":"0973401a-80de-4653-b933-a9cc47e9cfbd","text":"I am logged in and on the projects page","type":"Context","astNodeIds":["692a045e-a500-4690-aaa6-3c3c6d0c00bd"]},{"id":"ff4dacad-f2b7-4f01-bd12-9a985501db2d","text":"I select a project from the list","type":"Action","astNodeIds":["f7e9fdb5-75a9-4f1a-b79e-56764640e4f0"]},{"id":"35519667-b552-4153-9542-b52ccf071ff4","text":"I click on the gear icon","type":"Action","astNodeIds":["7f9693c1-d4e9-488e-b5bf-c1850993ce37"]},{"id":"a482aba4-079e-4a21-a6dd-ca9cb111d01e","text":"project settings modal should open","type":"Outcome","astNodeIds":["7937598e-f64a-4ad4-b948-f333d8610920"]},{"id":"8ce25648-a3e0-466d-b361-56b9d7526a93","text":"the modal should display three columns","type":"Outcome","astNodeIds":["a776b9bc-891e-4860-9ac2-d6a6bce2342c"]},{"id":"80182429-4feb-46ef-b5a9-7ad59edff9c1","text":"the first column should contain input fields","type":"Outcome","astNodeIds":["e8f71ae0-e71d-4570-8c61-4b95d6840c09"]},{"id":"8cbee2c3-2ba1-4f2e-abb8-7de5819e9ba8","text":"the second column should contain checkboxes for client actions","type":"Outcome","astNodeIds":["af698707-4a0b-4f9d-9322-5628d07d6035"]},{"id":"74daff47-c455-4969-9b06-e06c01b4eeed","text":"the third column should contain checkboxes for client visibility","type":"Outcome","astNodeIds":["0d522c71-79bd-4ff4-8496-1dd33ec45b07"]}]}},{"source":{"data":"@project-settings\r\nFeature: Project Settings Fields Update\r\n\r\n\r\n  Background:\r\n    Given I am logged in and on the projects page\r\n    When I select a project from the list\r\n    And I navigate to project settings\r\n\r\nScenario: Verify Updating Input Fields of project setting\r\n  # @project-name\r\n  # Scenario: Update Project Name\r\n    When I click on the Project Name field\r\n    And I enter \"Updated Project Name\" into the Project Name field\r\n    Then the Project Name field should contain \"Updated Project Name\"\r\n\r\n  # @project-number\r\n  # Scenario: Update Project Number\r\n    When I click on the Project Number field\r\n    And I enter \"PRJ-12345\" into the Project Number field\r\n    Then the Project Number field should contain \"PRJ-12345\"\r\n\r\n  # @project-budget\r\n  # Scenario: Update Project Budget\r\n    When I click on the Project Budget field\r\n    And I enter \"50000\" into the Project Budget field\r\n    Then the Project Budget field should contain \"50000\"\r\n\r\n  # @project-markup\r\n  # Scenario: Update Project Markup Percentage\r\n    When I click on the Project Markup field\r\n    And I enter \"15\" into the Project Markup field\r\n    And I press Enter\r\n    And I click on the yes button\r\n    Then the Project Markup field should contain \"15\"\r\n\r\n  # @project-sales-tax\r\n  # Scenario: Update Project Sales Tax Percentage\r\n    When I click on the Project Sales Tax field\r\n    And I enter \"7.5\" into the Project Sales Tax field\r\n    And I press Enter\r\n    And I click on the yes button\r\n    Then the Project Sales Tax field should contain \"7.5\"\r\n\r\n  # @project-shipping\r\n  # Scenario: Update Shipping Percentage\r\n    When I click on the Shipping field\r\n    And I enter \"5\" into the Shipping field\r\n     And I press Enter\r\n    And I click on the yes button\r\n    Then the Shipping field should contain \"5\"\r\n\r\n  # @project-currency\r\n  # Scenario: Update Currency\r\n    When I click on the Currency dropdown\r\n    And I select \"US Dollar\" from the Currency dropdown\r\n    Then the Currency dropdown should show \"US Dollar\" \r\n\r\n    # Scenario: save project setting \r\n    When I click on the save project button\r\n    Then project setting should be saved\r\n\r\n  @project-markup-tooltip-select-yes\r\n  Scenario: Verify the project markup functionality\r\n    When I locate the project markup field with tooltip\r\n    And I hover over the project markup tooltip\r\n    Then tooltip information should appear\r\n    When I enter \"20\" in the project markup field\r\n    And I press Enter to save value\r\n    Then all existing values should not be overridden\r\n    When I click on the yes button\r\n    Then all existing values should be overridden\r\n    When I click on the save project button\r\n    Then project setting should be saved\r\n\r\n    @project-markup-tooltip-select-no\r\n  Scenario: Verify the project markup functionality\r\n    When I locate the project markup field with tooltip\r\n    And I hover over the project markup tooltip\r\n    Then tooltip information should appear\r\n    When I enter \"14\" in the project markup field\r\n    And I press Enter to save value\r\n   Then all existing values should not be overridden\r\n    When I click on the No button\r\n    Then all existing values should not be overridden\r\n    When I click on the save project button\r\n    Then project setting should be saved\r\n\r\n\r\n@project-project-Sales-tax-select-yes\r\n  Scenario: Verify the project sales tax functionality\r\n    When I locate the project sale tax field with tooltip\r\n    And I hover over the project sales tax tooltip\r\n    Then tooltip information should appear\r\n    When I enter \"11\" into the Project Sales Tax field\r\n    And I press Enter to save value\r\n    Then a dialog asking about overriding values should appear\r\n    When I click on the yes button\r\n    Then all existing values should be overridden\r\n    When I click on the save project button\r\n    Then project setting should be saved\r\n\r\n    @project-project-Sales-tax-select-no\r\n  Scenario: Verify the project sales tax\r\n    When I locate the project sale tax field with tooltip\r\n    And I hover over the project sales tax tooltip\r\n    Then tooltip information should appear\r\n    When I enter \"10\" into the Project Sales Tax field\r\n    And I press Enter to save value\r\n    Then a dialog asking about overriding values should appear\r\n    When I click on the No button\r\n    Then all existing values should not be overridden\r\n    When I click on the save project button\r\n    Then project setting should be saved\r\n\r\n    @project-shipping-select-yes\r\n  Scenario: Verify the project shipping functionality\r\n    When I locate the project shipping field with tooltip\r\n    And I hover over the shipping tax tooltip\r\n    Then tooltip information should appear\r\n    When I enter \"25\" into the Shipping field\r\n    And I press Enter to save value\r\n    Then a dialog asking about overriding values should appear\r\n    When I click on the yes button\r\n    Then all existing values should be overridden\r\n    When I click on the save project button\r\n    Then project setting should be saved\r\n\r\n    @project-shipping-select-no\r\n  Scenario: Verify the project shipping functionality\r\n   When I locate the project shipping field with tooltip\r\n    And I hover over the shipping tax tooltip\r\n    Then tooltip information should appear\r\n    And I enter \"35\
